    }

    render() {
        return (
            <div>
                <div>
                    <Link to={'/'}>Back</Link>
                </div>
                <div>
                    <form onSubmit={this.handleSubmit}>
                        <label>
                            Latitude: <input type='text' name='latitude'></input>
                        </label>
                        <label>
                            Longitude: <input type='text' name='latitude'></input>
                        </label>
                    </form>
                </div>
            </div>
        )
    }
}
